css:
.editor .wrap-guide {
  background: rgba(0, 0, 0, 0.1);
}
.editor .indent-guide {
  color: rgba(0, 0, 0, 0.15);
}
.editor,
.editor .gutter {
  background-color: #D7D7D7;
  color: #07070D;
}
.editor .line-number,
.editor .gutter .line-number {
  opacity: 1;
  color: #6C6C70;
}
.editor .line-number.git-line-added,
.editor .gutter .line-number.git-line-added {
  border-left: 2px solid #AD64D0;
}
.editor .line-number.git-line-modified,
.editor .gutter .line-number.git-line-modified {
  border-left: 2px solid #002A96;
}
.editor .line-number.git-line-removed,
.editor .gutter .line-number.git-line-removed {
  border-left: 2px solid #6BAFAE;
}
.editor.is-focused .cursor {
  border-color: #07070F;
}
.editor.is-focused .selection .region {
  background-color: #B6B7C1;
}
.editor.is-focused .line-number.cursor-line-no-selection {
  background-color: #B6B7C1;
}
.editor .invisible-character {
  color: rgba(40, 40, 40, 0.15);
}
.editor .comment {
  color: #8A8EA1;
}
.editor .string {
  color: #19248B;
}
.editor .constant.numeric {
  color: #517E00;
}
.editor .constant.language {
  color: #517E00;
}
.editor .variable.language {
  color: #992610;
}
.editor .constant.character,
.editor .constant.other {
  color: #517E00;
}
.editor .keyword {
  color: #06D98D;
}
.editor .storage {
  color: #06D98D;
}
.editor .storage.type {
  font-style: italic;
  color: #992610;
}
.editor .entity.name.class {
  text-decoration: underline;
  color: #591DD1;
}
.editor .entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #591DD1;
}
.editor .entity.name.function {
  color: #591DD1;
}
.editor .entity.name.instance {
  color: #992610;
}
.editor .variable.parameter {
  font-style: italic;
  color: #0268E0;
}
.editor .entity.name.tag {
  color: #06D98D;
}
.editor .entity.other.attribute-name {
  color: #591DD1;
}
.editor .support.function {
  color: #992610;
}
.editor .support.constant {
  color: #992610;
}
.editor .support.type,
.editor .support.class {
  font-style: italic;
  color: #992610;
}
.editor .invalid {
  color: #07070F;
  background-color: #06D98D;
}
.editor .invalid.deprecated {
  color: #F8F8F0;
  background-color: #06D98D;
}
.editor .class.jade {
  color: #517E00;
}
